import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import '../styles/UserManagement.css';

function UserManagement() {
  const [users, setUsers] = useState([]);
  const [applications, setApplications] = useState([]);
  const [newUser, setNewUser] = useState({ username: '', email: '', userType: 'end' });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  useEffect(() => {
    fetchUsers();
    fetchApplications();
  }, []);

  const fetchUsers = async () => {
    try {
      const data = await api.getUsers();
      setUsers(data);
      setLoading(false);
    } catch (err) {
      setError('Failed to fetch users');
      setLoading(false);
    }
  };

  const fetchApplications = async () => {
    try {
      const data = await api.getApplications();
      setApplications(data);
    } catch (err) {
      setError('Failed to fetch applications');
    }
  };

  const handleAddUser = async () => {
    if (newUser.username && newUser.email) {
      try {
        await api.createUser(newUser);
        setSuccess('User created successfully');
        fetchUsers();
        setNewUser({ username: '', email: '', userType: 'end' });
      } catch (err) {
        setError('Failed to create user');
      }
    } else {
      setError('Please fill in all required fields');
    }
  };

  const handleAssignAppToAdmin = async (adminId, appId) => {
    try {
      await api.assignAppToAdmin(adminId, appId);
      setSuccess('Application assigned to admin successfully');
      fetchUsers();
    } catch (err) {
      setError('Failed to assign application to admin');
    }
  };

  const handleRemoveAppFromAdmin = async (adminId, appId) => {
    try {
      await api.removeAppFromAdmin(adminId, appId);
      setSuccess('Application removed from admin successfully');
      fetchUsers();
    } catch (err) {
      setError('Failed to remove application from admin');
    }
  };

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="user-management-container">
      <h3>User Management</h3>

      {success && <div className="success-message">{success}</div>}

      <div className="add-user-form">
        <input
          type="text"
          value={newUser.username}
          onChange={(e) => setNewUser({ ...newUser, username: e.target.value })}
          placeholder="Username"
        />
        <input
          type="email"
          value={newUser.email}
          onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
          placeholder="Email"
        />
        <select
          value={newUser.userType}
          onChange={(e) => setNewUser({ ...newUser, userType: e.target.value })}
        >
          <option value="end">End User</option>
          <option value="app_admin">App Admin</option>
        </select>
        <button onClick={handleAddUser}>Add User</button>
      </div>

      <div className="users-list">
        {users.map((user) => (
          <div key={user.user_id} className="user-card">
            <div className="user-info">
              <h4>{user.username}</h4>
              <p>{user.email}</p>
              <span className={`user-type ${user.user_type}`}>{user.user_type}</span>
            </div>

            {user.user_type === 'app_admin' && (
              <div className="admin-apps">
                <h5>Assigned Applications</h5>
                <div className="apps-list">
                  {user.assigned_apps?.map(app => (
                    <div key={app.app_id} className="app-tag">
                      {app.app_name}
                      <button
                        className="remove-app"
                        onClick={() => handleRemoveAppFromAdmin(user.user_id, app.app_id)}
                      >
                        Ã—
                      </button>
                    </div>
                  ))}
                </div>
                <select
                  onChange={(e) => {
                    const appId = e.target.value;
                    if (appId) {
                      handleAssignAppToAdmin(user.user_id, appId);
                      e.target.value = '';
                    }
                  }}
                  defaultValue=""
                >
                  <option value="" disabled>Assign Application</option>
                  {applications
                    .filter(app => !user.assigned_apps?.some(a => a.app_id === app.app_id))
                    .map(app => (
                      <option key={app.app_id} value={app.app_id}>
                        {app.app_name}
                      </option>
                    ))}
                </select>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserManagement;
